import React from "react";
import { Link } from "react-router-dom";
import "bootstrap-icons/font/bootstrap-icons.css";

const Navbar = ({ toggle }) => {
  return (
    <nav
      className="navbar navbar-expand-lg navbar-light   d-flex justify-content-between px-2"
      style={{ backgroundColor: "#ececf1" }}
    >
      <div className="container-fluid">
        <div onClick={toggle}>
          <span>
            {" "}
            <i className="bi bi-list h-100 w-100"></i>
          </span>
        </div>

        <nav className="navbar navbar-expand-lg navbar-light bg-light">
  {/* <button className="navbar-toggler"  data-bs-toggle="collapse" data-bs-target="#navbarCollapse" aria-controls="navbarCollapse" aria-expanded="false" aria-label="Toggle navigation"> */}
    <span className="navbar-toggler-icon"></span>
  {/* </button> */}

  <div className="collapse navbar-collapse" id="navbarCollapse">
    <ul className="navbar-nav ms-auto">
      <li className="nav-item dropdown">
        <Link className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
          <i className="bi bi-person-circle h-100 w-100"></i> My Account
        </Link>
        <div className="dropdown-menu" aria-labelledby="navbarDropdown">
          <Link className="dropdown-item" to="#">Profile</Link>
          <Link className="dropdown-item" to="#">Settings</Link>
          <div className="dropdown-divider"></div>
          <Link className="dropdown-item" to="/">Logout</Link>
        </div>
      </li>
    </ul>
  </div>
</nav>
      </div>
    </nav>
  );
};

export default Navbar;
